import React from 'react';
import "./Register.css";

function Register() {
  return (
    <div className='login'>
        <div className="loginWrapper">
            <div className="loginLeft">
                <h3 className="loginLogo">Postagrammm</h3>
                <span className="loginDesc">Connecting hearts together!ðŸ’ž</span>
            </div>
            <div className="loginRight">
                <div className="loginBox">
                    <input  placeholder="enter your username" type="text" className="loginInput" />
                    <input  placeholder="enter your email address" type="Email" className="loginInput" />
                    <input  placeholder="enter your Password" type="Password" className="loginInput" />
                    <input  placeholder="Re-enter your Password" type="Password" className="loginInput" />
                    <button className='loginButton'>Sign UP</button>
                    {/* <span className="loginforgot">Forgot Password?</span> */}
                    <button className="loginRegister">Logn in</button>
                </div>
            </div>
        </div>

    </div>
  )
}

export default Register;
